import React from "react";
import { Track } from "../api/track/models/Track";
import { useTheme } from "@mui/material/styles";
import Box from "@mui/material/Box";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import IconButton from "@mui/material/IconButton";
import Typography from "@mui/material/Typography";
import SkipPreviousIcon from "@mui/icons-material/SkipPrevious";
import PlayArrowIcon from "@mui/icons-material/PlayArrow";
import SkipNextIcon from "@mui/icons-material/SkipNext";

interface TrackItemProps {
  track: Track;
  onDelete: (trackId: string) => void;
}

export const TrackItem: React.FC<TrackItemProps> = ({ track, onDelete }) => {
  const theme = useTheme();
  return (
    <>
      <Card sx={{ display: "flex" }}>
        <Box sx={{ display: "flex", flexDirection: "column" }}>
          <CardContent sx={{ flex: "1 0 auto" }}>
            <Typography component="div" variant="h5">
              Live From Space
            </Typography>
            <Typography
              variant="subtitle1"
              component="div"
              sx={{ color: "text.secondary" }}
            >
              Mac Miller
            </Typography>
          </CardContent>
          <Box sx={{ display: "flex", alignItems: "center", pl: 1, pb: 1 }}>
            <IconButton aria-label="previous">
              {theme.direction === "rtl" ? (
                <SkipNextIcon />
              ) : (
                <SkipPreviousIcon />
              )}
            </IconButton>
            <IconButton aria-label="play/pause">
              <PlayArrowIcon sx={{ height: 38, width: 38 }} />
            </IconButton>
            <IconButton aria-label="next">
              {theme.direction === "rtl" ? (
                <SkipPreviousIcon />
              ) : (
                <SkipNextIcon />
              )}
            </IconButton>
          </Box>
        </Box>
        <CardMedia
          component="img"
          sx={{ width: 150 }}
          image="https://media.istockphoto.com/id/1040315976/uk/%D1%84%D0%BE%D1%82%D0%BE/%D0%B6%D1%96%D0%BD%D0%BA%D0%B0-%D1%8F%D0%BA%D0%B0-%D0%B4%D0%B8%D0%B2%D0%B8%D1%82%D1%8C%D1%81%D1%8F-%D0%BD%D0%B0-%D0%B2%D0%B8%D0%B4-%D0%B7-%D0%BF%D0%B5%D1%87%D0%B5%D1%80%D0%B8-%D0%BC%D0%B0%D1%82%D0%B5%D1%80%D0%B0-%D0%B1%D0%B0%D0%B7%D0%B8%D0%BB%D1%96%D0%BA%D0%B0%D1%82%D0%B0-%D1%96%D1%82%D0%B0%D0%BB%D1%96%D1%8F.jpg?s=2048x2048&w=is&k=20&c=jna9JcLJx8f70hD0q4bJUqXe-bQLei_6IgJsmiYzZSs="
          alt="Live from space album cover"
        />
      </Card>

      <div className="bg-white rounded-2xl overflow-hidden shadow-lg hover:shadow-xl transition-shadow duration-300 border border-gray-200 hover:-translate-y-1 transform">
        {/* Cover Image */}
        {track.coverImage && (
          <div className="relative group">
            <img
              src={
                "https://media.istockphoto.com/id/1040315976/uk/%D1%84%D0%BE%D1%82%D0%BE/%D0%B6%D1%96%D0%BD%D0%BA%D0%B0-%D1%8F%D0%BA%D0%B0-%D0%B4%D0%B8%D0%B2%D0%B8%D1%82%D1%8C%D1%81%D1%8F-%D0%BD%D0%B0-%D0%B2%D0%B8%D0%B4-%D0%B7-%D0%BF%D0%B5%D1%87%D0%B5%D1%80%D0%B8-%D0%BC%D0%B0%D1%82%D0%B5%D1%80%D0%B0-%D0%B1%D0%B0%D0%B7%D0%B8%D0%BB%D1%96%D0%BA%D0%B0%D1%82%D0%B0-%D1%96%D1%82%D0%B0%D0%BB%D1%96%D1%8F.jpg?s=2048x2048&w=is&k=20&c=jna9JcLJx8f70hD0q4bJUqXe-bQLei_6IgJsmiYzZSs="
              }
              alt={track.title}
              style={{ width: "200px" }}
            />
            <div className="absolute bottom-0 left-0 right-0 bg-gradient-to-t from-black/70 to-transparent p-3">
              <h3 className="text-white text-lg font-semibold truncate">
                {track.title}
              </h3>
            </div>
          </div>
        )}

        {/* Content */}
        <div className="p-4">
          <p className="text-gray-800 font-semibold">{track.artist}</p>
          <p className="text-sm text-gray-500">{track.album}</p>

          {/* Audio Player */}
          {track.audioFile && (
            <audio
              controls
              className="w-full mt-4 rounded-lg border border-gray-300"
            >
              <source src={track.audioFile} type="audio/mpeg" />
              Ваш браузер не підтримує аудіо.
            </audio>
          )}

          <button
            className="mt-4 px-4 py-2 bg-red-500 text-white rounded hover:bg-red-600 transition"
            onClick={() => onDelete(track.id)}
          >
            Delete
          </button>
        </div>
      </div>
    </>
  );
};
